ck(it_secondary.primary == 11, "bad primary value!"); check(secondary == 22, "bad secondary value!"); let ret = check_fn(it_secondary, |data: &MyData| { data.a1 == 11 && data.a2 == 22 }); check(ret, "bad secondary next value"); } //test for Idx64DB.upperbound { let (it_secondary, secondary) = idx.upperbound(22); check(it_secondary.primary == 111, "upperbound: bad primary value!"); eosio_println!("+++++++secondary:", secondary); check(secondary == 222, "upperbound: bad secondary value!"); let ret = check_fn(it_secondary, |data: &MyData| { data.a1 == 111 && data.a2 == 222 }); check(ret, "bad secondary next value"); } } } }
